const all_images = [];
const all_videos = [];
const all_news = [];

const inputNodes = [
  'Brave Images', 'Google Custom Search (Imagens)', 'Serper.dev (Images)', 'TheSportsDB',
  'Brave Videos', 'Gaveta VIP (Embeds)',
  'Brave Web', 'Brave News', 'Google Search (Web)'
];

inputNodes.forEach(nodeName => {
  try {
    const items = $items(nodeName);
    items.forEach(item => {
      const data = item.json;

      // Coleta Imagens
      if (nodeName.includes('Images') || nodeName === 'TheSportsDB' || nodeName.includes('Imagens')) {
        const results = data.results || data.items || data.images || [];
        if (data.player?.[0]?.strCutout) all_images.push(data.player[0].strCutout);
        if (data.teams?.[0]?.strTeamBadge) all_images.push(data.teams[0].strTeamBadge);
        results.forEach(r => {
          const url = r.image?.url || r.link || r.imageUrl;
          if (url) all_images.push(url);
        });
      }

      // Coleta Vídeos
      if (nodeName.includes('Videos') || nodeName.includes('Embeds')) {
        const results = data.results || data.items || (Array.isArray(data) ? data : []);
        results.forEach(r => {
          const url = r.video?.url || r.link || r.embed || r.url;
          if (url) all_videos.push(url);
        });
      }

      // Coleta News/Web
      if (nodeName.includes('Web') || nodeName.includes('News')) {
        const results = data.results || data.items || [];
        results.forEach(r => {
          if (r.title) all_news.push({ title: r.title, url: r.url || r.link });
        });
      }
    });
  } catch (e) {}
});

// Remove duplicatas básicas
const unique_images = [...new Set(all_images)];
const unique_videos = [...new Set(all_videos)];

return { 
  json: { 
    assets: { 
      all_images: unique_images, 
      all_videos: unique_videos, 
      all_news: all_news.slice(0, 10),
      type: $node['Parse Roteiro'].json.type
    } 
  } 
};

/*
  CÓDIGO BLINDADO - V3
  Objetivo: Extrair mídias sem quebrar se o nó anterior falhar.
*/

// 1. Tenta recuperar os dados de todas as formas possíveis
let entrada = {};
let rssData = {};

try {
  // Tenta pegar do input direto (o mais comum)
  entrada = $input.first().json;
} catch (e) {
  // Se falhar, inicia vazio
  entrada = {};
}

try {
  // Tenta pegar do RSS como backup de segurança
  rssData = $('Monitora FreshRSS').first().json;
} catch (e) {
  rssData = {};
}

// 2. Define o Texto Final (Prioridade: Python > RSS)
// Se 'texto_materia' não existir, usa o snippet do RSS
const texto = 
  entrada.texto_materia || 
  entrada.texto_processado ||
  rssData.contentSnippet || 
  rssData.content || 
  "";

// 3. Extração de Imagens (Via Regex no texto)
const imagemMatches = texto.matchAll(/https?:\/\/.*?\.(jpg|png|jpeg|gif|webp)/ig);
let imagens = Array.from(imagemMatches, m => m[0]);

// Adiciona imagens extras que o Python possa ter encontrado
if (entrada.imagens_encontradas && Array.isArray(entrada.imagens_encontradas)) {
  imagens = [...imagens, ...entrada.imagens_encontradas];
}

// 4. Extração de Vídeos
const videoMatches = texto.matchAll(/https?:\/\/.*?\.(mp4|webm)|youtu\.be\/[a-zA-Z0-9_-]+|youtube\\.com\/watch\?v=[a-zA-Z0-9_-]+/ig);
let videos = Array.from(videoMatches, m => m[0]).slice(0, 3);

// 5. Define a Capa (Prioridade: Python > Regex > RSS > Placeholder)
const imagem_principal = 
  entrada.imagem_principal || 
  imagens[0] || 
  (rssData.enclosure ? rssData.enclosure.url : null) ||
  'https://via.placeholder.com/1280x720?text=Noticia+Sem+Foto';

// 6. Retorno Limpo
return { 
  json: { 
    imagens: [...new Set(imagens)].slice(0, 5), // Remove duplicatas
    videos: videos, 
    imagem_principal: imagem_principal,
    texto_processado: texto // Envia o texto garantido para a IA
  } 
};

const html = $node["Descobre Link Real"].json.texto_materia;

// Regex para extrair o link real do artigo (Google News usa <a href="..." class="..."> ou meta)
const linkMatch = html.match(/<a[^>]*href="([^"]*?)"[^>]*class="[^"]*?article[^"]*"/i) ||
                  html.match(/<link rel="canonical" href="([^"]*)"/i) ||
                  html.match(/window\.location\.replace\("([^"]*)"\)/i);

const linkReal = linkMatch ? linkMatch[1] : $node["Monitora FreshRSS"].json.link; // Fallback para o original se não achar

return { json: { link_real: decodeURIComponent(linkReal) } };

const input = $input.all();
const groups = {
  premier_league: [],
  la_liga: [],
  serie_a: [],
  brasileirao: [],
  outros: []
};

input.forEach(item => {
  const video = item.json;
  const competition = (video.competition || '').toLowerCase();

  if (competition.includes('premier league')) groups.premier_league.push(video);
  else if (competition.includes('la liga')) groups.la_liga.push(video);
  else if (competition.includes('serie a')) groups.serie_a.push(video);
  else if (competition.includes('brasileirão') || competition.includes('brazil')) groups.brasileirao.push(video);
  else groups.outros.push(video);
});

return { json: groups };
